import React from 'react'

function SearchBar(props) {

    const select = (e) => {
        console.log(e.target.textContent)
    }

    return (
        <div className='searchs_bar'>
            <input list="city" type="text" id="city" onChange={props.change} autoComplete='off' />
            <div className='results_list'>
                {
                    props.list.map((element, index) => {
                        return <div className='result' key={index} onClick={select}>{element}</div>
                    })
                }
            </div>
        </div>
    )
}

export default SearchBar
